import React from "react";

import Todo from "./Todo";

const List = ({ todoList }) => {
    const rerenderedList = todoList.map((item) => <Todo title={item.title} />);

    return(
        <div className="ui grid center aligned">
            {rerenderedList}
        </div>
    );
}

export default List;
